import logo from "../img/logo.png";
import Card from "./Card";
const CardContainer = ()=>{
    return (
        <>
            <div className="container-fluid">
                <div className="row">
                    <Card/>
                    <Card/>
                    <Card/>
                    <Card/>
                    <Card/>
                    <Card/>
                </div>

            </div>
        </>
    );
}

export default CardContainer;
